import React from "react";
import { Link } from "react-router-dom";

const StartWindow = () => {
  return (
    <>
      <ul>
        <h2>Chooose</h2>
        <li>
          <h3>Start game</h3>
          <Link to="/start">Start</Link>
        </li>
        <li>
          <h3>About</h3>
          <Link to="/about">About</Link>
        </li>
      </ul>
    </>
  );
};

export default StartWindow;
